square.last-move {
    will-change: transform;
    background-color: rgba(50,200,255,0.3);
}
square.move-dest {
    background: radial-gradient(rgba(0,0,0,0.3) 19%, rgba(0,0,0,0) 20%);
    pointer-events: auto;
}
square.oc.move-dest {
    background: radial-gradient(transparent 0%, transparent 80%, rgba(112,229,204,0.7)80%);
}
square.selected {
    background-color: rgba(112,229,204,0.5);
}
